import React from "react";
import classes from "./AboutMEStyles.module.css";

export const AboutME = () => {
    return (
        <div className={classes.content}>
            <h1>Skills</h1>
            <div className={classes.fr}>
                <h2>Frontend</h2>
            </div>
            <div className={classes.bac}>
                <h2>Backend</h2>
            </div>
        </div>
    );
};
